import React from "react";
import "./index.css"
import SlotM from "./Slotmach";
  
const App=()=>{
    return <>
    <h2  className="heading_style">🎰 Welcome to <span  style={{fontWeight:'bold'}}>Slot machine game </span>🎰</h2>
    <div className="slot-machine">
    <SlotM  x='😄' y='😄' z='😄'/>
    <SlotM x='😄' y='😄' z='🎅🏻'/>
    <SlotM x='🌟' y='❤️' z='🐾'/>
    <SlotM x='🍇' y='🍇' z='🍇'/>
    <SlotM x='👻' y='🦉' z='🕊️'/>
    </div>
    </>

};


export default App;
export {SlotM};
